# TEST cases should cover the different boundary cases.

class testpoint(unittest.TestCase):
	
	def test_weather_response(self):
		self.assertEqual(weather_response("Delhi","5037fc7fbdffa8b55a9ea3820f12bf43"), delhi_json)
		self.assertEqual(weather_response("Mumbai","5037fc7fbdffa8b55a9ea3820f12bf43"), mumbai_json)
		self.assertEqual(weather_response("New York","5037fc7fbdffa8b55a9ea3820f12bf43"), newyork_json)
		self.assertEqual(weather_response("Dublin","5037fc7fbdffa8b55a9ea3820f12bf43"), dublin_json)
		self.assertEqual(weather_response("London","5037fc7fbdffa8b55a9ea3820f12bf43"), london_json)

	def test_has_error(self):
		self.assertFalse(has_error('Delhi', delhi_json), None)
		self.assertFalse(has_error('Mumbai', mumbai_json), None)
		self.assertFalse(has_error('New York', newyork_json), None)
		self.assertFalse(has_error('Dublin', dublin_json), None)
		self.assertTrue(has_error('1234', wrong_json), True)
	
	def test_get_temperature(self):
		self.assertAlmostEqual(get_temperature(delhi_json, 0, '18:00:00'), 295.97, delta=5)
		self.assertAlmostEqual(get_temperature(mumbai_json, 0, '18:00:00'), 302.95, delta=5)
		self.assertAlmostEqual(get_temperature(newyork_json, 0, '18:00:00'), 297.38, delta=5)
		self.assertAlmostEqual(get_temperature(dublin_json, 0, '18:00:00'), 286.11, delta=5)
		self.assertAlmostEqual(get_temperature(london_json, 0, '18:00:00'), 284.91, delta=5)

	def test_get_humidity(self):
		self.assertAlmostEqual(get_humidity(delhi_json, 0, '18:00:00'), 77, delta=5)
		self.assertAlmostEqual(get_humidity(mumbai_json, 0, '18:00:00'), 92, delta=5)
		self.assertAlmostEqual(get_humidity(newyork_json, 0, '18:00:00'), 74, delta=5)
		self.assertAlmostEqual(get_humidity(dublin_json, 0, '18:00:00'), 99, delta=5)
		self.assertAlmostEqual(get_humidity(london_json, 0, '18:00:00'), 58, delta=5)

	def test_get_pressure(self):
		self.assertAlmostEqual(get_pressure(delhi_json, 0, '18:00:00'), 997.28, delta=5)
		self.assertAlmostEqual(get_pressure(mumbai_json, 0, '18:00:00'), 1021.19, delta=5)
		self.assertAlmostEqual(get_pressure(newyork_json, 0, '18:00:00'), 1034.49, delta=5)
		self.assertAlmostEqual(get_pressure(dublin_json, 0, '18:00:00'), 1033.84, delta=5)
		self.assertAlmostEqual(get_pressure(london_json, 0, '18:00:00'), 1031.97, delta=5)

	def test_get_wind(self):
		self.assertAlmostEqual(get_wind(delhi_json, 0, '18:00:00'), 1.22, delta=5)
		self.assertAlmostEqual(get_wind(mumbai_json, 0, '18:00:00'), 3.32, delta=5)
		self.assertAlmostEqual(get_wind(newyork_json, 0, '18:00:00'), 2.82, delta=5)
		self.assertAlmostEqual(get_wind(dublin_json, 0, '18:00:00'), 9.17, delta=5)
		self.assertAlmostEqual(get_wind(london_json, 0, '18:00:00'), 3.32, delta=5)



	def test_get_sealevel(self):
		self.assertAlmostEqual(get_sealevel(delhi_json, 0, '18:00:00'), 1022.05, delta=5)
		self.assertAlmostEqual(get_sealevel(mumbai_json, 0, '18:00:00'), 1021.92, delta=5)
		self.assertAlmostEqual(get_sealevel(newyork_json, 0, '18:00:00'), 1037.89, delta=5)
		self.assertAlmostEqual(get_sealevel(dublin_json, 0, '18:00:00'), 1038.66, delta=5)
		self.assertAlmostEqual(get_sealevel(london_json, 0, '18:00:00'), 1039.72, )
			

